Les aiguilles de Bavella (I Forchi di Bavedda en corse) dominent le col du même nom à 1 218 m, reliant l'Alta Rocca à la côte est de la Corse. Le massif est moins élevé et pourtant bien plus fréquenté que celui des aiguilles de Popolasca. Le site se caractérise par des pics déchiquetés, de grandes murailles rocheuses et des pins tordus par le vent.
Au cœur du massif de Bavella, on trouve les sept tours d'Asinau (les aiguilles de Bavella proprement dites, anciennement numérotées du sud au nord) :

Punta di l'Acellu (Punta ll'Aceddu, 1 588 m) (Tour I) ;
Punta di l'Ariettu (Punta ll'Arghjetu, 1 591 m) (Tour II) ;
Punta di a Vacca (Punta lla Vacca, 1 611 m) (Tour III), la seule accessible au simple randonneur ;
Punta di u Pargulu (Punta llu Pàrgulu, 1 785 m) (Tour IV), séparée de la précédente par la Bocca di u Pargulu (1 662 m), empruntée par la variante alpine du GR 20 ;
Punta Longa (1 836 m) (Tour V) ;
Punta Alta (1 855 m) (Tour VI), la plus haute des aiguilles ;
Punta Iolla (1 848 m) (Tour VII), séparée de la précédente par la Bocca di u Santu (1 745 m).Le massif de Bavella dans sa globalité culmine un peu plus au nord, à la Punta di u Furnellu (Punta llu Furneddu) et à la Punta Muvrareccia (A Mufrareccia), tous deux à 1 899 m d'altitude. Il est dominé par le grand sommet de la région, le Monte Incudine (2 134 m), et s'étend de la forêt de Tova au nord (commune de Solaro) jusqu'au Monte Calva (1 381 m) au sud, à la limite du massif de l'Ospedale, et pour ainsi dire jusqu'à Conca et la mer à l'est.
De l'Incudine au col de Bavella, le GR 20, après avoir atteint le refuge d'Asinau (1 536 m), passe au pied des aiguilles dans la vallée du Rizzanese (Asinau) mais une variante dite « alpine » permet de s'approcher des tours de Bavella, via la Bocca di u Pargulu (Bocca llu Pàrgulu, 1 662 m). Après le col de Bavella, le sentier entame sa descente vers Conca, via la Foce Finosa (1 206 m) et le refuge d'i Paliri (1 055 m), au pied de la Punta Tafunata di i Paliri (montagne trouée comme son nom l'indique, à l'instar du Capu Tafunatu, 1 312 m).
Au col, à quelques mètres de la route, sur le vaste terre-plein, se dresse au sommet d'un amas de pierres la statue de Notre-Dame-des-Neiges. La Purcaraccia, ruisseau célèbre par ses cascades et piscines naturelles. Départ du sentier, à environ 8 km, sur la D268 en direction de Sari-Solenzara.
Les localités de Quenza, Zonza et Conca sont implantées en arc de cercle au sud-ouest du col de Bavella.

La bambouseraie en Cévennes (connue aussi sous le nom bambouseraie d'Anduze ou bambouseraie de Prafrance) est un jardin exotique situé à Générargues dans le Gard.
Unique en Europe par ses dimensions, la bambouseraie en Cévennes se situe dans un domaine d'une superficie de 34 hectares (le parc, seule partie ouverte au public, couvre à lui seul 15 hectares) à 11 km au sud-ouest d’Alès et à 2 km au nord d’Anduze. Elle contient des bambous plantés à partir de 1856 par Eugène Mazel (es).
C'est un parc ouvert au public, qui comprend :

une forêt de bambous géants ;
le bambousarium : propose sur une petite surface une sélection de différentes espèces de bambous présents sur le site ;
un jardin d’inspiration japonaise ;
un labyrinthe ;
un village laotien ;
le vallon du Dragon : ce jardin japonais créé en 2000 (année du Dragon), s’étend sur 15 000 m2 et repose sur les principes du Feng Shui ;
des serres construites en 1860 par Eugène Mazel ;
un jardin floral ;
Le jardin des Bassins d'Eugène
Une jardinerie (ventes de bambous et nombreuses autres plantes) en accès libre.
Une grande boutique
Un snack en étéLes bambous prospèrent dans ce site qui bénéficie d'un climat très favorable à leur culture et forment une véritable jungle. Ce parc a servi de cadre pour le tournage de plusieurs films, dont Le Salaire de la peur, d'après le roman de Georges Arnaud, et Paul et Virginie.
Depuis quelques années, à la manière de nombreux autres jardins contemporains, le site accueille des installations d'artistes, plus ou moins pérennes ou éphémères.
